import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router';

import { ScreeningRecruiter } from './containers/Screening/Recruiter';

import './index.scss';

export function App() {
  return (
    <BrowserRouter>
        <Routes>
            <Route path='/screening/recruiter' Component={ScreeningRecruiter} />
        </Routes>
    </BrowserRouter>
  );
}
